import React, { useState, useEffect } from 'react';
import "../styles/Home.css";
import crackd1 from "../assets/crackd-homepage.png";
import crackd2 from "../assets/crackdmultihumor.png";
import crackd3 from "../assets/crackdLogoBlack.png";

const phrases = [
  'user interfaces',
  'user experiences',
  'website design',
];

function Typewriter({ words, speed = 150, pause = 2000 }) {
  const [displayedText, setDisplayedText] = useState('');
  const [wordIndex, setWordIndex] = useState(0);
  const [charIndex, setCharIndex] = useState(0);
  const [deleting, setDeleting] = useState(false);

  useEffect(() => {
    let timeout;
    const currentWord = words[wordIndex];

    if (!deleting) {
      if (charIndex < currentWord.length) {
        // Typing forward
        timeout = setTimeout(() => {
          setDisplayedText(currentWord.substring(0, charIndex + 1));
          setCharIndex(charIndex + 1);
        }, speed);
      } else {
        // Word fully typed, pause before deleting
        timeout = setTimeout(() => {
          setDeleting(true);
        }, pause);
      }
    } else {
      if (charIndex > 0) {
        // Deleting backward
        timeout = setTimeout(() => {
          setDisplayedText(currentWord.substring(0, charIndex - 1));
          setCharIndex(charIndex - 1);
        }, speed / 2);
      } else {
        // Finished deleting, move to next word
        timeout = setTimeout(() => {
          setDeleting(false);
          setWordIndex((wordIndex + 1) % words.length);
        }, 500);
      }
    }

    return () => clearTimeout(timeout);
  }, [charIndex, deleting, wordIndex, words, speed, pause]);

  return <span>{displayedText}</span>;
}

function Tagline() {
  return (
    <div>
      <h1 className="tagline">
        an interdisciplinary designer
        <br />
        focused on creating
        <br />
        <span className="typewriter-container">
        meaningful <Typewriter words={phrases} />
        </span>
      </h1>
    </div>
  );
}

function HumorProjectTextSection() {
  return (
    <div> {/* no maxWidth or negative margin here */}
      <h1 className="projectName" style={{ marginTop: 0 }}>The Humor Project</h1>
      <h2 className="projectDescriptionHeader">
        second mini header describing the project
      </h2>
      <p className="projectDescription">
        description description description description
        description description description description
        description description description description
      </p>
    </div>
  );
}



function HumorProjectImagesSection() {
  return (
  <div>
    <h2 style={{ textAlign: "right" }}>
    User-Interfaces & Web Design
    </h2>

    <div style={{ position: "relative", width: "100%", height: 500, marginTop: 0  }}>

      {/* Overlapping images */}
      <img
        src={crackd1}
        alt="Corporate Site Homepage"
        style={{ position: "absolute", top: 0, left: 0, right: 10, width: "65%",
        height: "auto", zIndex: 1, transform: "scale(0.9)"}}
      />
      <img
        src={crackd2}
        alt="Webpage Mockup"
        style={{ position: "absolute", top: 100, left: 220, width: "80%",
        height: "auto", zIndex: 2, transform: "scale(0.65)"  }}
      />
      <img
        src={crackd3}
        alt="Crackd Logo"
        style={{ position: "absolute", bottom: 0, left: 0, width: 180, height: "auto", zIndex: 3 }}
      />
    </div>
    </div>
  );
}


export default function Home() {
  return (
    <div>
      <Tagline />

      {/* Optional: put the shared section label here so it doesn't shift only the image column */}
      {/* <h2 style={{ marginTop: '2rem' }}>User-Interfaces & Web Design</h2> */}

      <div style={{ display: "flex", alignItems: "flex-start", gap: "2rem", marginTop: "2rem" }}>
        <div style={{ flex: "0 0 48%" }}>
          <HumorProjectTextSection />
        </div>

        {/* Push the whole image block to the right within its 40% column */}
        <div style={{ flex: "0 0 52%", marginLeft: "auto" }}>
          <HumorProjectImagesSection />
        </div>
      </div>
    </div>
  );
}
